    "If the unit was previously published and released to students, any changes you made to the unit when it was hidden will now be visible to students. Do you want to proceed?": "Je\u015bli ekran zosta\u0142 uprzednio opublikowany i upubliczniony studentom, wszelkie wprowadzone zmiany do ekranu, gdy by\u0142 ukryty, stan\u0105 si\u0119 teraz widoczne dla student\u00f3w. Czy chcesz kontynuowa\u0107?",
