    "If you leave this page without saving or submitting your response, you will lose any work you have done on the response.": "Je\u017celi opu\u015bcisz t\u0119 stron\u0119 bez zapisania lub przes\u0142ania swojej odpowiedzi, stracisz ca\u0142\u0105 swoj\u0105 prac\u0119.",
    "If you leave this page without submitting your peer assessment, you will lose any work you have done.": "Je\u017celi opu\u015bcisz t\u0119 stron\u0119 bez przes\u0142ania zadania do oceny, stracisz ca\u0142\u0105 swoj\u0105 prac\u0119.",
    "If you leave this page without submitting your self assessment, you will lose any work you have done.": "Je\u017celi opu\u015bcisz t\u0119 stron\u0119 bez przes\u0142ania swojego zadania, stracisz ca\u0142\u0105 swoj\u0105 prac\u0119.",
    "If you leave this page without submitting your staff assessment, you will lose any work you have done.": "Je\u017celi opu\u015bcisz t\u0119 stron\u0119 bez przes\u0142ania oceny, stracisz ca\u0142\u0105 swoj\u0105 prac\u0119.",
    "If you leave, you can no longer post in this team's discussions.Your place will be available to another learner.": "Je\u015bli odejdziesz, nie b\u0119dziesz ju\u017c m\u00f3g\u0142 publikowa\u0107 w dyskusjach tego zespo\u0142u.Twoje miejsce b\u0119dzie dost\u0119pne dla innego uczestnika.",
    "If you make significant changes, make sure you notify members of the team before making these changes.": "Je\u015bli chcesz wprowadzi\u0107 znacz\u0105ce zmiany, pami\u0119taj o wcze\u015bniejszym poinformowaniu o tym zamiarze pozosta\u0142ych cz\u0142onk\u00f3w zespo\u0142u.",
    "If you make this %(xblockType)s visible to learners, learners will be able to see its content after the release date has passed and you have published the unit. Only units that are explicitly hidden from learners will remain hidden after you clear this option for the %(xblockType)s.": "Je\u015bli zaznaczysz, \u017ce ta %(xblockType)s jest widoczna dla student\u00f3w, b\u0119d\u0105 oni widzie\u0107 jej zawarto\u015b\u0107 po opublikowaniu i osi\u0105gni\u0119ciu daty upublicznienia. Wy\u0142\u0105cznie ekrany oznaczone jako ukryte przed studentami pozostan\u0105 ukryte po wy\u0142\u0105czeniu przez ciebie tej opcji dla %(xblockType)s.",
    "If you proceed, you will be unable to use this account to take courses on the {platformName} app, {siteName}, or any other site hosted by {platformName}.": "Je\u015bli przejdziesz dalej, nie b\u0119dziesz m\u00f3g\u0142 u\u017cywa\u0107 tego konta do uczestnictwa w kursach w aplikacji {platformName}, {siteName} lub jakiejkolwiek innej witrynie obs\u0142ugiwanej przez {platformName}.",
    "If you remove this transcript, the transcript will not be available for any components that use this video.": "Je\u015bli usuniesz t\u0119 transkrypcj\u0119, b\u0119dzie ona niedost\u0119pna dla element\u00f3w wykorzystuj\u0105cych ten film.",
    "If you remove this transcript, the transcript will not be available for this component.": "Je\u015bli usuniesz t\u0119 transkrypcj\u0119, b\u0119dzie ona niedost\u0119pna dla tego elementu.",
    "If you require assistance with taking either photo for submission, contact %(platformName)s support for additional suggestions.": "Je\u017celi potrzebujesz pomocy podczas wykonywania zdj\u0119cia, skontaktuj si\u0119 z  %(platformName)swsparciem. ",
    "If you select an option other than \"%(hide_label)s\", published units in this subsection become available to learners unless they are explicitly hidden.": "Je\u015bli wybierzesz opcj\u0119 inn\u0105 ni\u017c \"%(hide_label)s\", opublikowane ekrany w tej lekcji stan\u0105 si\u0119 dost\u0119pne dla student\u00f3w, chyba, \u017ce s\u0105 oznaczone jako ukryte.",
    "If you still wish to continue and delete your account, please enter your account password:": "Je\u015bli wci\u0105\u017c chcesz kontynuowa\u0107 i usun\u0105\u0107 swoje konto, wprowad\u017a swoje has\u0142o:",
    "If you use the Advanced Editor, this problem will be converted to XML and you will not be able to return to the Simple Editor Interface.\n\nProceed to the Advanced Editor and convert this problem to XML?": "Je\u015bli skorzystasz z zaawansowanego edytora, to \u0107wiczenie zostanie zamienione na XML i nie b\u0119dzie mo\u017cna powr\u00f3ci\u0107 do interfejsu prostego edytora\n\nPrzej\u015b\u0107 do zaawansowanego edytora i przekonwertowa\u0107 \u0107wiczenie na XML?",
