    "To access the courses available to you through {enterpriseName}, visit the {enterpriseName} dashboard.": "Aby uzyska\u0107 dost\u0119p do kurs\u00f3w dost\u0119pnych dla u\u017cytkownika za po\u015brednictwem {enterpriseName}, odwied\u017a pulpit {enterpriseName}.",
    "To be sure all students can access the video, we recommend providing both an .mp4 and a .webm version of your video. Click below to add a URL for another version. These URLs cannot be YouTube URLs. The first listed video that's compatible with the student's computer will play.": "Aby upewni\u0107 si\u0119, \u017ce wszyscy studenci b\u0119d\u0105 mogli odtworzy\u0107 film, zalecamy dostarczenie wersji filmu w formatach .mp4 jak i .webm. Kliknij poni\u017cej, aby doda\u0107 odno\u015bnik do kolejnej wersji. Odno\u015bnik nie mo\u017ce prowadzi\u0107 do Youtube. Studentowi odtworzony zostanie pierwszy film kompatybilny z jego komputerem.",
    "To continue learning with this account, sign in below.": "Aby kontynuowa\u0107 nauk\u0119 za po\u015brednictwem tego konta, zaloguj si\u0119.",
    "To invalidate a certificate for a particular learner, add the username or email address below.": "W celu uniewa\u017cnienia certyfikatu dla okre\u015blonego studenta, wprowad\u017a poni\u017cej jego nazw\u0119 u\u017cytkownika lub adres e-mail.",
    "To receive a certificate, you must also verify your identity before {date}.": "Aby otrzyma\u0107 certyfikat, musisz r\u00f3wnie\u017c potwierdzi\u0107 swoj\u0105 to\u017csamo\u015b\u0107 przed {date}.",
    "To receive a certificate, you must also verify your identity.": "Aby otrzyma\u0107 certyfikat, musisz r\u00f3wnie\u017c potwierdzi\u0107 swoj\u0105 to\u017csamo\u015b\u0107.",
    "To receive credit for problems, you must select \"Submit\" for each problem before you select \"End My Exam\".": "Aby otrzyma\u0107 punkty za \u0107wiczenia, musisz klikn\u0105\u0107 \"Wy\u015blij\" dla ka\u017cdego pojedynczego \u0107wiczenia, zanim wybierzesz \"Zako\u0144cz m\u00f3j egzamin\".",
    "To review learner cohort assignments or see the results of uploading a CSV file, download course profile information or cohort results on the {link_start}Data Download{link_end} page.": "Aby sprawdzi\u0107 przydzia\u0142 student\u00f3w do kohort lub pozna\u0107 efekty za\u0142adowania pliku CSV, pobierz informacje profilowe z kursu lub przegl\u0105d kohort ze strony {link_start}pobierania danych{link_end}.",
    "To share your certificate on Mozilla Backpack, you must first have a Backpack account. Complete the following steps to add your certificate to Backpack.": "Aby podzieli\u0107 si\u0119 swoim certyfikatem w Mozilla Backpack, najpierw musisz posiada\u0107 konto w Backpack. Wykonaj poni\u017csze czynno\u015bci w celu dodania swojego certyfikatu do Backpack.",
    "To take a successful photo, make sure that:": "Aby wykona\u0107 prawid\u0142owe zdj\u0119cie, upewnij si\u0119, \u017ce",
    "To take the photo of your face, click on the camera button {icon}. If you need to try again, click 'Retake Photo'.": "W celu wykonania zdj\u0119cia swojej twarzy, kliknij na przycik aparatu {icon}. Je\u015bli musisz powt\u00f3rzy\u0107 zdj\u0119cie, kliknij \"Pon\u00f3w zdj\u0119cie\".",
