    "Use Onboarding to introduce learners to proctoring, verify their identity, and create an onboarding profile. Learners must complete the onboarding profile step prior to taking a proctored exam. Profile reviews take 2+ business days.": "Wykorzystaj socjalizacj\u0119 organizacyjn\u0105 aby oswoi\u0107 uczni\u00f3w z nadzorem, sprawd\u017a ich to\u017csamo\u015b\u0107 i utw\u00f3rz profil socjalizacyjny. Uczniowie musz\u0105 przej\u015b\u0107 etap profilowania socjalizacyjnego przed przyst\u0105pieniem do nadzorowanego egzaminu. Opiniowanie profilu zajmuje dwa lub wi\u0119cej dni robocze.",
    "Use a practice proctored exam to introduce learners to the proctoring tools and processes. Results of a practice exam do not affect a learner's grade.": "Skorzystaj z pr\u00f3bnego egzaminu nadzorowanego w celu zaznajomienia student\u00f3w z jego narz\u0119dziami i procedurami. Wyniki pr\u00f3bnego egzaminu nie wp\u0142ywaj\u0105 na oceny studenta.",
    "Use a timed exam to limit the time learners can spend on problems in this subsection. Learners must submit answers before the time expires. You can allow additional time for individual learners through the Instructor Dashboard.": "U\u017cyj egzaminu z limitem czasu, aby ograniczy\u0107 czas, jaki studenci mog\u0105 przeznaczy\u0107 na rozwi\u0105zywanie \u0107wicze\u0144. Studenci musz\u0105 przes\u0142a\u0107 odpowiedzi przed up\u0142ywem limitu czasu. Poprzez pulpit instruktora mo\u017cesz przyzna\u0107 wybranym studentom wi\u0119cej czasu.",
    "Use as a Prerequisite": "U\u017cyj jako wymagania wst\u0119pnego",
