    "We just need a little more information before you start learning with %(platformName)s.": "Potrzebujemy jeszcze nieco informacji zanim b\u0119dziesz m\u00f3g\u0142 rozpocz\u0105\u0107 nauk\u0119 w %(platformName)s.",
    "We securely encrypt your photo and send it to our authorization service for review. Your photo and information are not saved or visible anywhere on %(platformName)s after the verification process is complete.": "Bezpiecznie szyfrujemy twoje zdj\u0119cie i wysy\u0142amy je do naszego serwisu autoryzacyjnego w celu sprawdzenia. Twoje zdj\u0119cie i informacje nie s\u0105 zapisywane nigdzie na %(platformName)s ani widoczne po zako\u0144czeniu procesu weryfikacji.",
    "We use the highest levels of security available to encrypt your photo and send it to our authorization service for review. Your photo and information are not saved or visible anywhere on %(platformName)s after the verification process is complete.": "U\u017cywamy najwy\u017cszych dost\u0119pnych poziom\u00f3w bezpiecze\u0144stwa w celu szyfrowania zdj\u0119\u0107 i przesy\u0142ania ich do sprawdzenia. Po zako\u0144czeniu czynno\u015bci weryfikacyjnych,  twoje zdj\u0119cia i dane z dokumentu nie s\u0105 zapisywane ani widoczne gdziekolwiek na \u0142amach %(platformName)s.",
    "We use your verification photos to confirm your identity and ensure the validity of your certificate.": "Wykorzystujemy zdj\u0119cie weryfikacyjne w celu potwierdzenia twojej to\u017csamo\u015bci i zagwarantowania wa\u017cno\u015bci twojego certyfikatu.",
    "We're sorry to see you go! Your account will be deleted shortly.": "Przykro nam, \u017ce odchodzisz! Twoje konto zostanie wkr\u00f3tce usuni\u0119te.",
    "We're sorry, there was an error": "Przepraszamy, wyst\u0105pi\u0142 b\u0142\u0105d",
    "We've encountered an error. Refresh your browser and then try again.": "Napotkali\u015bmy b\u0142\u0105d. Od\u015bwie\u017c przegl\u0105dark\u0119 i spr\u00f3buj ponownie.",
    "We've sent a confirmation message to {new_email_address}. Click the link in the message to update your email address.": "Wys\u0142ali\u015bmy wiadomo\u015b\u0107 potwierdzaj\u0105c\u0105 na adres {new_email_address}. Kliknij \u0142\u0105cze znajduj\u0105ce si\u0119 w jej tre\u015bci, aby zaktualizowa\u0107 sw\u00f3j adres e-mail.",
    "We've sent a confirmation message to {new_secondary_email_address}. Click the link in the message to update your secondary email address.": "Wys\u0142ali\u015bmy wiadomo\u015b\u0107 z potwierdzeniem na adres {new_secondary_email_address}. Kliknij link w wiadomo\u015bci, aby zaktualizowa\u0107 dodatkowy adres e-mail.",
    "We've sent a message to {email}. Click the link in the message to reset your password. Didn't receive the message? Contact {anchorStart}technical support{anchorEnd}.": "Na adres {email} zosta\u0142a wys\u0142ana wiadomo\u015b\u0107. Kliknij w odno\u015bnik w wiadomo\u015bci, aby zresetowa\u0107 has\u0142o. Je\u015bli wiadomo\u015b\u0107 nie dotar\u0142a, skontaktuj si\u0119 z {anchorStart}pomoc\u0105 techniczn\u0105{anchorEnd}.",
