    "What does this mean?": "Co to oznacza?",
    "What if I can't see the camera image, or if I can't see my photo do determine which side is visible?": "Co zrobi\u0107, je\u015bli nie widz\u0119 obrazu z kamery lub je\u015bli nie mog\u0119 zobaczy\u0107 swojego zdj\u0119cia, aby okre\u015bli\u0107, kt\u00f3ra strona jest widoczna?",
    "What if I have difficulty holding my ID in position relative to the camera?": "Co zrobi\u0107, je\u015bli mam trudno\u015bci z utrzymaniem dowodu to\u017csamo\u015bci w odpowiedniej pozycji wzgl\u0119dem kamery?",
    "What if I have difficulty holding my head in position relative to the camera?": "Co zrobi\u0107, je\u017celi nie potrafi\u0119 utrzyma\u0107 g\u0142owy we w\u0142a\u015bciwej pozycji?",
