    "What industry do you want to work in?": "W jakiej bran\u017cy chcesz pracowa\u0107?",
    "What is the highest level of education that any of your parents or guardians have achieved?": "Jaki jest najwy\u017cszy poziom wykszta\u0142cenia, jaki osi\u0105gn\u0105\u0142 kt\u00f3rykolwiek z Twoich rodzic\u00f3w lub opiekun\u00f3w?",
    "What is the highest level of education that you have achieved so far?": "Jaki jest najwy\u017cszy poziom wykszta\u0142cenia, jaki osi\u0105gn\u0105\u0142e\u015b do tej pory?",
    "What was the total combined income, during the last 12 months, of all members of your family? ": "Jaki by\u0142 \u0142\u0105czny doch\u00f3d wszystkich cz\u0142onk\u00f3w Twojej rodziny w ci\u0105gu ostatnich 12 miesi\u0119cy? ",
    "What's Your Next Accomplishment?": "Co b\u0119dzie twoim kolejnym osi\u0105gni\u0119ciem?",
    "When learners submit an answer to an assessment, they immediately see whether the answer is correct or incorrect, and the score received.": "W momencie kiedy studenci prze\u015bl\u0105 odpowied\u017a na zadanie, natychmiast widz\u0105, czy ich odpowied\u017a jest poprawna, czy b\u0142\u0119dna, a tak\u017ce uzyskany wynik.",
    "When your face is in position, use the Take Photo button {icon} below to take your photo.": "Gdy Twoja twarz jest na swoim miejscu, u\u017cyj przycisku Zr\u00f3b zdj\u0119cie {icon} poni\u017cej, aby zrobi\u0107 zdj\u0119cie.",
    "Which timed transcript would you like to use?": "Kt\u00f3r\u0105 transkrypcj\u0119 chcesz wykorzysta\u0107?",
    "While our support team is happy to assist with the edX platform, the course staff has the expertise for specific assignment questions, grading or the proper procedures in each course. Please post all course related questions within the Discussion Forum where the Course Staff can directly respond.": "Nasz zesp\u00f3\u0142 pomocy technicznej z przyjemno\u015bci\u0105 pomo\u017ce Ci w obs\u0142udze platformy edX, jednak personel kursu posiada wiedz\u0119 na temat konkretnych pyta\u0144 zwi\u0105zanych z zadaniami, ocenianiem lub w\u0142a\u015bciwymi procedurami w ka\u017cdym kursie. Wszelkie pytania zwi\u0105zane z kursem prosimy umieszcza\u0107 na Forum Dyskusyjnym, gdzie pracownicy kursu b\u0119d\u0105 mogli bezpo\u015brednio na nie odpowiedzie\u0107.",
