    "You may access your account with this address if single-sign on or access to your primary email is not available.": "Mo\u017cesz uzyska\u0107 dost\u0119p do swojego konta za pomoc\u0105 tego adresu, je\u015bli jednokrotne logowanie lub dost\u0119p do g\u0142\u00f3wnego adresu e-mail nie jest dost\u0119pny.",
    "You may also lose access to verified certificates and other program credentials like MicroMasters certificates. If you want to make a copy of these for your records before proceeding with deletion, follow the instructions for {htmlStart}printing or downloading a certificate{htmlEnd}.": "Mo\u017cesz r\u00f3wnie\u017c utraci\u0107 dost\u0119p do zweryfikowanych certyfikat\u00f3w i innych danych uwierzytelniaj\u0105cych program, takich jak certyfikaty MicroMasters. Je\u015bli chcesz wykona\u0107 ich kopi\u0119, by m\u00f3c j\u0105 zachowa\u0107 przed przest\u0105pieniem do usuwania, post\u0119puj zgodnie z instrukcj\u0105 dotycz\u0105c\u0105 {htmlStart}drukowania lub pobierania certyfikatu{htmlEnd}.",
    "You may be able to complete the image capture procedure without assistance, but it may take a couple of submission attempts to get the camera positioning right.  Optimal camera positioning varies with each computer, but generally the best position for a headshot is approximately 12-18 inches (30-45 centimeters) from the camera, with your head centered relative to the computer screen. ": "Mo\u017cesz by\u0107 w stanie doko\u0144czy\u0107 procedur\u0119 przechwytywania obrazu bez pomocy, ale prawid\u0142owe ustawienie kamery mo\u017ce wymaga\u0107 przes\u0142ania kilku pr\u00f3b. Optymalne ustawienie kamery r\u00f3\u017cni si\u0119 w zale\u017cno\u015bci od komputera, ale og\u00f3lnie najlepsza pozycja do zdj\u0119cia to oko\u0142o 30-45 centymetr\u00f3w (12-18 cali ) od kamery, z g\u0142ow\u0105 wy\u015brodkowan\u0105 wzgl\u0119dem ekranu komputera.",
    "You may be able to complete the image capture procedure without assistance, but it may take a couple of submission attempts to get the camera positioning right.  Optimal camera positioning varies with each computer, but generally, the best position for a photo of an ID card is 8-12 inches (20-30 centimeters) from the camera, with the ID card centered relative to the camera. ": "Mo\u017cesz by\u0107 w stanie doko\u0144czy\u0107 procedur\u0119 przechwytywania obrazu bez pomocy, ale prawid\u0142owe ustawienie kamery mo\u017ce wymaga\u0107 przes\u0142ania kilku pr\u00f3b. Optymalne ustawienie aparatu r\u00f3\u017cni si\u0119 w zale\u017cno\u015bci od komputera, ale generalnie najlepsz\u0105 pozycj\u0105 zdj\u0119cia dowodu to\u017csamo\u015bci jest 20-30 centymetr\u00f3w (8-12 cali) od aparatu, z dowodem to\u017csamo\u015bci wy\u015brodkowanym wzgl\u0119dem aparatu.",
